import Link from "next/link";

import Logo from './Logo';

import "./../../styles/components/Header.scss";

const Header = props => (
    <div className="Header">
       <Link href="/">
         <Logo />
       </Link>
      {props.appTitle}
    </div>
);

export default Header;
